import React from 'react';

import { Grid } from '@material-ui/core';

import { SearchBar } from './compononets/SearchBar';
import { VideoList } from './compononets/VideoList';
import { VideoDetail } from './compononets/SearchBar';

import youtube from './api/youtube'

class App extends React.Component {
    render () {
        return (
            <Grid className='container' container spacing={16}>
                <Grid item xs={12}>
                    <Grid container spacing={16}>
                        <Grid item xs={12}>
                            {/*SEARCH BAR*/}
                        </Grid>
                        <Grid item xs={8}>
                            {/*VIDEO DETAILS*/}
                        </Grid>
                        <Grid item xs={4}>
                            {/*VIDEO LIST*/}
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>
        )
    }
}

export default App;
